import React,{ useState,browserHistory } from 'react';
import './App.css';
import Login from './admin/login/Login';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import User from './admin/management/User';
import Category from './admin/category/Category';
import Protected from './services/Protected'
// import Question from './admin/question/Question';

function App() {
  return (
    <>
      <Router history={browserHistory}>
           <Route path="/login" component={Login}/>
           <Protected path="/usermanagement" component={User}/>
           <Protected path="/category" component={Category}/>
           {/* <Protected path="/question" component={Question}/> */}
      </Router>
    </>
  );
}

export default App;
